export const AIRPORT_LIST_OPTION: AirportOption[] = AIRPORT_LIST.map((e) => {
  return {
    value: e.AirportCode,
    label: `${e.AirportCode} - ${e.AirportName} - ${e.City}, ${e.Country}`,
  };
});

export const getAirportDetailsFromCode = (code: string) => {
  const airplane = AIRPORT_LIST.find(
    (airplane) => airplane.AirportCode === code
  );
  return `${airplane?.AirportName} (${airplane?.AirportCode}) - ${airplane?.City}, ${airplane?.Country}`;
};
